import './App.css';
import Intro from './components/navbar/Intro';
import Header from './components/navbar/Header';
import Skills from './components/navbar/Skills'
import { Grid } from '@mui/material';

function App() {
  return (
    <Grid sx={{ overflow: 'hidden', }}>
      <Header />
      <Intro />
      <Skills />
    </Grid>
  );
}

export default App;
